import React from "react";
import notes from "./notes";

notes.map((entry) => (
  <Note key={entry.key} title={entry.title} content={entry.content} />
));

export default function Note(props) {
  return (
    <div className="note">
      <h1>{props.title}</h1>
      <p>{props.content}</p>
    </div>
  );
}
